/*!50003 CREATE*/ /*!50017 DEFINER=`zhenglei`@`120.24.232.79`*/ /*!50003 TRIGGER `eteacher`.`class_list_AFTER_INSERT` AFTER INSERT ON `class_list` FOR EACH ROW
 begin
    declare schedule_tid int(11) default 0;
    declare new_class_start_date varchar(12);
    declare new_class_start_time varchar(12);
    declare new_teacher_tid int(11) default 0;
    select teacher_tid into new_teacher_tid from order_list where tid = new.order_tid;
    select new.class_start_date into new_class_start_date;
    select left(new.class_start_time, 5) into new_class_start_time;
    select tid into schedule_tid from teacher_schedule A where A.teacher_tid = new_teacher_tid and A.schedule_date = new_class_start_date and A.schedule_time = new_class_start_time;
    update teacher_schedule A set time_busy = 1, class_tid=new.tid where A.tid = schedule_tid; 
end */;;
DELIMITER ;
