/*!50003 CREATE*/ /*!50017 DEFINER=`zhenglei`@`120.24.232.79`*/ /*!50003 TRIGGER `eteacher`.`class_list_AFTER_UPDATE` AFTER UPDATE ON `class_list` FOR EACH ROW
begin
declare var_teacher_tid int(11) default 0;
select teacher_tid into var_teacher_tid from order_list where tid = old.order_tid;
update teacher_schedule set time_busy =  0 where new.state = 2 and var_teacher_tid = teacher_tid and 
schedule_date = old.class_start_date and schedule_time = old.class_start_time and tid > 0; 
end */;;
