INSERT INTO `class_quality_details` VALUES (6,6,'适学学生','sef','课程介绍','sgs',NULL,NULL,'http://testapi.e-teacher.cn/shortCourseImage/Shanghai6detailPic.png','就地学英语'),(9,9,'适学学生','适合英语写作基础薄弱、写作思路局限，欲短期内提高高考英语写作水平的学生。','课程介绍','1. 权威的ET名师团队、独家的专业教材、完善的一对一高考写作课程体系。<br>2. 高考写作各类文体题材写作技巧专项训练，名师辅导开阔写作思路。<br>3. 每课时45分钟，每次课两课时。',NULL,NULL,'http://testapi.e-teacher.cn/shortCourseImage/Shanghai9detailPic.png','高中写作强化班'),(10,10,'1','1','1','1',NULL,NULL,'http://testapi.e-teacher.cn/shortCourseImage/Shanghai10detailPic.png','1'),(11,11,'适学学生','适合英语基础薄弱、有阅读困难、期望学习正确阅读方法和技巧来提高阅读成绩的学生。','课程介绍','1. 权威的ET名师团队、独家的专业教材、完善的一对一高考阅读课程体系。<br>2. 高考阅读各类文体题材专项训练，独家解题技巧灵活运用。<br>3. 每课时45分钟，每次课两课时。',NULL,NULL,'http://testapi.e-teacher.cn/shortCourseImage/Shanghai11detailPic.png','高中阅读强化班'),(13,13,'适学学生','适合3-5岁的幼儿。','课程介绍','1.由美国最富盛名的儿童畅销书作家Richard Scarry编写。<br>23.本课程共包含20个课时（每周1到2课时，每课时30分钟）。<br>3.本课程以绘本故事展开，以小朋友喜爱的卡通动物形象展示童趣的故事和原汁原味的美式口语。<br>4.独特新颖的试听题材给小朋友带来视听盛宴。<br>5.全课程采用美国真人外教一对一在线授课。<br>',NULL,NULL,'http://testapi.e-teacher.cn/shortCourseImage/Shanghai13detailPic.png','幼儿绘本课'),(16,16,'适学学生','适合英语零基础到小学二年级以上的孩子学习。','课程介绍','1.本课程共包含16个课时（每课时30分钟，建议每周两次课）。<br>2.由北京师范大学出版社出版发行。<br>3.根据小学英语教材选词，并配上丰富的插图，为孩子提供充满趣味的情境式学习体验，让孩子产生学习兴趣，家长更省心。<br>4.让孩子轻松掌握英语单词拼读规律，举一反三，达到“见词能读，听音能写”，迅速提升学习效率，为英语学习奠定最重要的基础。<br>5.全套课程由美国专业外教一对一在线授课。',NULL,NULL,'http://testapi.e-teacher.cn/shortCourseImage/Shanghai16detailPic.png','Phonics自然拼读课(1~3册)'),(17,17,'适学学生','适合小学二年级以上的孩子学习。','课程介绍','1.本课程共包含20个课时（每课时30分钟，建议每周两次课）。<br>2.由北京师范大学出版社出版发行。<br>3.根据小学英语教材选词，并配上丰富的插图，为孩子提供充满趣味的情境式学习体验，让孩子产生学习兴趣，家长更省心。<br>4.让孩子轻松掌握英语单词拼读规律，举一反三，达到“见词能读，听音能写”，迅速提升学习效率，为英语学习奠定最重要的基础。<br>5.全套课程由美国专业外教一对一在线授课。',NULL,NULL,'http://testapi.e-teacher.cn/shortCourseImage/Shanghai17detailPic.png','Phonics自然拼读课(4~5册)'),(18,20,'适学学生','小学生','课程介绍','很好',NULL,NULL,NULL,'小学词汇');
