/*!50003 CREATE*/ /*!50017 DEFINER=`zhenglei`@`120.24.232.79`*/ /*!50003 TRIGGER `eteacher`.`order_list_BEFORE_INSERT` BEFORE INSERT ON `order_list` FOR EACH ROW
 begin
   declare var_user_grade int default 1;
   declare var_class_content varchar(32);
   declare var_teacher_busy int default 0;
   
   select count(*) into var_teacher_busy from teacher_schedule where time_busy = 1 and new.order_date = schedule_date and new.order_time = schedule_time and teacher_tid= new.teacher_tid; 
   if (var_teacher_busy >0  ) then
     delete  from cancel_triggers where tid = 1;
     #delete from pay_list where order_tid = new.order_tid and tid > 0;
   end if;
 
   select user_grade into var_user_grade from user_info where user_info.tid = new.user_tid;
    if(var_user_grade = 0 ) then
        select concat("学前") into var_class_content;
	end if;
    
    if(var_user_grade >= 1 && var_user_grade <=5) then
        select concat("小学", var_user_grade, "年级") into var_class_content;
	end if;
    
    if(var_user_grade >= 6 && var_user_grade <=9) then
        select concat("初中", var_user_grade, "年级") into var_class_content;
	end if;
    
    if(var_user_grade >= 10 && var_user_grade <=12) then
        select concat("高中", var_user_grade, "年级") into var_class_content;
	end if;
    
    set new.class_content := var_class_content;
    
end */;;
DELIMITER ;
