/*!50003 CREATE*/ /*!50017 DEFINER=`zhenglei`@`120.24.232.79`*/ /*!50003 TRIGGER `eteacher`.`order_list_AFTER_INSERT` AFTER INSERT ON `order_list` FOR EACH ROW
begin
    declare schedule_tid int(11) default 0;
    declare new_order_time varchar(12);
    select left(new.order_time, 5) into new_order_time;
    select tid into schedule_tid from teacher_schedule A where A.teacher_tid = new.teacher_tid and A.schedule_date = new.order_date and A.schedule_time = new_order_time;
    update teacher_schedule A set time_busy = 1 where A.tid = schedule_tid; 
end */;;
DELIMITER ;
