/*!50003 CREATE*/ /*!50017 DEFINER=`zhenglei`@`120.24.232.79`*/ /*!50003 TRIGGER `eteacher`.`order_list_AFTER_UPDATE` AFTER UPDATE ON `order_list` FOR EACH ROW
begin
if ('2' = new.order_state) then
 
update class_list a set state = 2 where a.order_tid = old.tid and a.tid > 0; 
end if;

if((1 = new.pay_done)  and (0 = old.pay_done)) then
    update user_info set user_free_count = user_free_count + 1 where tid = new.user_tid;
end if;
end */;;
