-- Table structure for table `pay_list`
--

DROP TABLE IF EXISTS `pay_list`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pay_list` (
  `tid` int(11) NOT NULL AUTO_INCREMENT,
  `order_tid` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `pay_type` int(1) DEFAULT '0' COMMENT '支付方式，默认0值，为微信支付;1：支付宝；2：钱包；3：银联；4：现金；5：免费',
  `pay_done` int(1) DEFAULT '0' COMMENT '支付是否成功，0：未完成支付。1：成功',
  `out_trade_no` varchar(128) DEFAULT NULL COMMENT '第三方支付唯一商户订单号，如微信支付、支付宝支付',
  `buyer_id` varchar(60) DEFAULT NULL COMMENT '买家支付宝账号对应的支付宝\n唯一用户号。\n以2088开头的纯16位数字。',
  `trade_no` varchar(128) DEFAULT NULL COMMENT '支付宝交易号\n该交易在支付宝系统中的交易\n流水号。\n最短16位，最长64位(String)。',
  `pay_method` int(1) DEFAULT NULL COMMENT '支付类型 默认0\n0：支付\n1：充值\n2：拼课',
  `invitation_code` varchar(45) DEFAULT NULL COMMENT '邀请码',
  PRIMARY KEY (`tid`)
) ENGINE=InnoDB AUTO_INCREMENT=405 DEFAULT CHARSET=utf8 COMMENT='支付清单';
/*!40101 SET character_set_client = @saved_cs_client */;

