/*!50003 CREATE*/ /*!50017 DEFINER=`zhenglei`@`120.24.232.79`*/ /*!50003 TRIGGER `eteacher`.`pay_list_BEFORE_INSERT` BEFORE INSERT ON `pay_list` FOR EACH ROW
begin
 select count(*) into @countPayRecord from pay_list where order_tid = new.order_tid and pay_done=1; 
 if (@countPayRecord >0  ) then
     delete  from cancel_triggers where tid = 1;
     #delete from pay_list where order_tid = new.order_tid and tid > 0;
 end if;
end */;;
