/*!50003 CREATE*/ /*!50017 DEFINER=`dev`@`121.41.115.58`*/ /*!50003 TRIGGER `eteacher`.`pay_list_AFTER_UPDATE` AFTER UPDATE ON `pay_list` FOR EACH ROW
 begin
 if ((1 = new.pay_done ) && (0 = old.pay_done)) then
	 # 修改订单支付状态为成功（pay_done = 1）
     update order_list set order_list.pay_done = 1 where OLD.order_tid = order_list.tid;
     # 查询订单状态，如果为2（已取消订单），则修改为1（未排课订单）
	 select order_state into @order_state_var from order_list where OLD.order_tid = order_list.tid; 
	if (2 = @order_state_var) then
		update order_list set order_list.order_state = 1 where OLD.order_tid = order_list.tid;
	end if;
 end if;
 end */;;
