INSERT INTO `teacher_detail_info` VALUES (1,'',1,'http://testapi.e-teacher.cn/testfile/Teacher_detail_image/15801987158_1.png','http://testapi.e-teacher.cn/testfile/Teacher_detail_image/15801987158_2.png','教学特色','1.考实把握准确，善于总结“万能公式”；<br>2.倡导“趣味口诀学英语”；<br>3.课堂深入浅出，极具感染力。','成功案例','2014学年，李同学，九年级学生，语法薄弱，通过补习，中考提高了15分。','教师愿景','用爱心点燃学生的学习热情，用智慧引领孩子的茁壮成长。','好好学习，天天向上。'),(2,'',2,'http://testapi.e-teacher.cn/testfile/Teacher_detail_image/13262856032_1.png','http://testapi.e-teacher.cn/testfile/Teacher_detail_image/13262856032_2.png','教学特色','1.语法讲解深入浅出，通俗易懂；<br>2.注重解题方法，授人鱼更授人渔；<br>3.课堂上知识性与趣味性兼具，总结性与发散性并重。','成功案例','初中生辅导前成绩不及格，辅导后英语在班上名列前茅。','教师愿景','走进孩子的心，让孩子爱上英语。','培养兴趣，学好英语。'),(3,'',3,'http://testapi.e-teacher.cn/testfile/Teacher_detail_image/123_1.png','http://testapi.e-teacher.cn/testfile/Teacher_detail_image/123_2.png','教学特色','123','成功案例','123','教师愿景','123','123'),(4,'',4,'http://testapi.e-teacher.cn/testfile/Teacher_detail_image/1234_1.png','http://testapi.e-teacher.cn/testfile/Teacher_detail_image/1234_2.png','教学特色','123','成功案例','123','教师愿景','123','123'),(5,'',5,'http://testapi.e-teacher.cn/testfile/Teacher_detail_image/17377628393_1.png','http://testapi.e-teacher.cn/testfile/Teacher_detail_image/17377628393_2.png','教学特色','1.因材施教<br>2.由深到浅','成功案例','曾辅导一名学生由班级倒数，辅导一个学期，成绩到班级前五名。','教师愿景','由兴趣培养孩子，让同学们更好的了解英语。','好好学习，天天向上');
