DROP TABLE IF EXISTS `user_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user_info` (
  `tid` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(16) DEFAULT NULL COMMENT '用户姓名',
  `user_sex` varchar(2) DEFAULT NULL COMMENT '用户性别',
  `user_age` int(3) DEFAULT NULL COMMENT '用户年龄',
  `user_address` varchar(64) DEFAULT NULL COMMENT '用户详细地址',
  `user_area` varchar(16) DEFAULT NULL COMMENT '用户片区',
  `user_exchange_points` float(10,2) DEFAULT '0.00' COMMENT '用户积分，允许2位小数',
  `user_type` int(3) DEFAULT '0' COMMENT '用户类型，0：家长；1：学生。默认家长。第一版不区分家长和学生，默认为家长。',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '用户注册时间',
  `login_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '用户最近登录时间',
  `user_ID_card` varchar(32) DEFAULT NULL COMMENT '身份证号码',
  `user_image` varchar(512) DEFAULT NULL COMMENT '用户头像url',
  `login_pwd` varchar(32) DEFAULT NULL COMMENT '登录密码',
  `telephone` varchar(12) DEFAULT NULL COMMENT '用户手机号',
  `token` varchar(64) DEFAULT NULL COMMENT '用户登录token',
  `user_source` int(3) DEFAULT '0' COMMENT '0:App用户；1：微信用户',
  `open_id` varchar(64) DEFAULT NULL,
  `user_grade` int(2) DEFAULT NULL COMMENT '学生年级',
  `user_change_state` int(1) DEFAULT '0' COMMENT '学生临时调课状态',
  `user_free_num` int(1) DEFAULT '0' COMMENT '免费试课次数     为1时不能在免费使用',
  `user_nextmonth_state` int(1) DEFAULT '0' COMMENT '家长下月调课状态',
  `user_city` varchar(45) DEFAULT NULL COMMENT '学生城市',
  `user_add_class` int(1) DEFAULT '0' COMMENT '学生加课状态',
  `user_wallet_tid` int(11) DEFAULT NULL COMMENT '钱包外健',
  `user_free_count` int(1) DEFAULT '0' COMMENT '用户是否具有免费试课资格。0，具有；1，不具有。',
  `spelling_class_state` int(1) DEFAULT '0' COMMENT '拼课状态   0为未参与或发起拼课 \n                   1为正在拼课或者已发起拼课\n                     默认为未发起拼课',
  `fast_count` int(1) DEFAULT '0' COMMENT '快速约课次数，默认值为零。',
  `sc_tid` int(11) DEFAULT NULL COMMENT '市场人员tid 只要不为空就表示该学生已有专门的市场专员不可再次填写其他的 市场专员',
  `test_number` int(3) DEFAULT '0' COMMENT '学生测试次数',
  `test_state` int(1) DEFAULT NULL COMMENT '测试状态  0 计数测试  1无限测试 ',
  PRIMARY KEY (`tid`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='用户信息表。此表中用户包括家长和学生，不含教师与客服等。';
