DROP TABLE IF EXISTS `zip_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `zip_info` (
  `tid` int(11) NOT NULL AUTO_INCREMENT COMMENT '下载包的主键',
  `zip_name` varchar(45) NOT NULL COMMENT '下载包的名字，不含文件类型后缀',
  `zip_filetype` varchar(45) DEFAULT NULL COMMENT '文件类型后缀，如zip、apk',
  `zip_version` varchar(45) NOT NULL COMMENT '下载包的版本号',
  `zip_city` varchar(45) NOT NULL COMMENT '下载包的城市属性',
  `zip_detaile` varchar(500) NOT NULL COMMENT '下载包的详细描述',
  `zip_position` varchar(200) NOT NULL DEFAULT '' COMMENT '下载包在服务的存放目录，如：/framework/teacher/base/',
  `zip_force` int(1) NOT NULL DEFAULT '1' COMMENT '0:非强制更新,1:强制更新(默认)',
  `zip_platform` int(8) NOT NULL COMMENT '该zip可用平台,ABCDEFGH,每个字母代表一类平台是否可用,H表示安卓平台(0不可用,1可用),G表示苹果平台(0不可用,1可用),F表示为微信平台(0不可用,1可用),E、D、C、B、A表示其他平台(暂时未确定，0不可用,1可用),所有字母按顺序组合为一个二进制整数。例如，仅安卓可用，表示为00000001,可简写为1;仅苹果可用表示为00000010，可简写为2;安卓苹果均可用，则表示为00000011，可简写为3;以此类推',
  `container_tid` int(11) NOT NULL COMMENT '下载包所依赖的容器的tid',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '文件上传时间',
  PRIMARY KEY (`tid`)
) ENGINE=MyISAM AUTO_INCREMENT=33 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

